import React from "react";

const FruitsCard = ({ image, name, price, _callback }) => {
  const style = "thumb-container";
  return (
    <div className={style}>
      <img src={image} alt={name} />
      <div className="detail-wrapper">
        <h3>{name}</h3>
        <p>Price: {price} $</p>
      </div>
    </div>
  );
};

export default FruitsCard;
